import React from 'react';

function App() {
  return (
    <div className="flex">
      <div className="bg-green-100 w-10 h-10">1</div>
      <div className="bg-green-100 px-2">2</div>
      <div className="bg-green-100 px-2">3</div>
    </div>
  );
}

export default App;
